import React, { Component } from 'react';
// import axios from 'axios';



export default class cropCreate extends Component {


    constructor() {
        super();
        this.onChange = this.onChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);

        this.state = {
            item_id: '',
            fid: '',
            item_name: '',
            item_price: '',
            item_description: '',
            item_picture:''
        }
    }


    onChangeFid(e) {
        this.setState({
            fid: e.target.value
        });
    }
    onChangeName(e) {
        this.setState({
            item_name: e.target.value
        });
    }
    onChangePrice(e) {
        this.setState({
            item_price: e.target.value
        });
    }
    onChangeDescription(e) {
        this.setState({
            item_description: e.target.value
        });
    }


    handleSubmit(event) {
        event.preventDefault();
    }


    render() {
        return (
            <div>
                <form onSubmit={this.handleSubmit}>
                    <label>
                        Item Name:
                    <input type="text" value={this.state.item_name} onChange={this.onChangeFid} />
                    </label>
                    <label>
                        Description:
                    <input type="text" value={this.state.item_description} onChange={this.onChange} />
                    </label>
                    <label>
                        item image:
                    <input type="file" value={this.state.item_price} onChange={this.onChange} />
                    </label>

                    <input type="submit" value="Submit" />
                </form>
            </div>
        )
    }
}
